function runTrace() {
	module('cop.Tracing').load(true);

	var tracer = cop.Tracing.ObjectTracer.reset();
	tracer.recordTime = true;

	// set classes to trace
	var klasses = this.get('traceClasses').evalAll();
	cop.Tracing.ObjectTracer.instrument(klasses);

	// set ignore props
	tracer.ignoreList = tracer.ignoreList.concat(this.get('ignoreProperties').evalAll())

	// eval expression
	var expr = this.get('traceExpression').textString
	withLayers([cop.Tracing.ObjectTraceLayer], function() {
		eval(expr);
	}.bind(this))

	// show the result

	tracer.show(function(frame, depth) {
		var style = {color: Color.black}
		if (frame.obj.getFill && frame.obj.getFill() instanceof Color)
			style.color = frame.obj.getFill();
		// if (frame.obj.name == 'morph')
			// style.size = 18;
		return style
	}, this.get('traceResult'))

}

